import styled from 'styled-components'

export const Image = styled.img`
    max-width:300px;
    max-height:500px;
    border-radius:10px;
`
export const GalleryContainer = styled.div`
    margin:20px 20px;
    display:flex;
    flex-flow: row wrap;
    align-items:center;
    justify-content:space-evenly;
`

export const ImageContainer = styled.div`
    padding:10px;
    border-radius:10px;
    background:#d3dbd3;
`
